window.bookSummaryJSON = "<p>There are rules to being Abigail Crowne's bodyguard, rules to watching the infamous billion-dollar heiress, otherwise known as the Reject Princess.</p> <p>Never forget your place, always put the Crowne name above all else, and never, ever hurt the Reject. Especially don't torment the Reject. Even if she is a spoiled brat.</p> <p>So when an opportunity presents itself to punish her, you definitely shouldn't take it. Then again, Abigail loves to be tortured, and I've waited patiently for revenge. </p> <p>I'll keep her safe...with cruel protection.</p> <p>Love is off-limits with Abigail Crowne, but no one said anything about hate.</p> <p><b>Contains mature themes.</b></p>"; 
